import './Signup.css';






    const Signin1 = (props) => {
        return (
                <div> 
                   
                     <form >
                       <div className="signup">
                       <p className="text">Enter Email Add. :</p>
                       <input className="inputbox" type="email"  />
                   </div>
                   <div className="signup">
                       <p className="text">Enter Password :</p>
                       <input className="inputbox" type="password" />
                   </div><br/>
                <input type="submit"/>
                </form>
               </div>
        );
    }

  
   



export default Signin1;
